I think that DeviceStaticInfoManager should be related to  SlaveStaticInfo and DutStaticInfoand here.
This association is good and can solve the coupling problem.

for example:
class DeviceStaticInfoManager:
# cls member.
registered_devices_map = {
 'slave_static_info' : SlaveStaticInfo,
 'dut_static_info'   : DutStaticInfo,
}
def __init__(self,dev_type **kwargs):
  self.slave_static_info = registered_devices_map[dev_type]
